/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var findMaxAverage = function (nums, k) {
  const l = nums.length;
  let sum = nums.slice(0, k).reduce((a, b) => a + b);
  let maxSum = sum;
  for (let i = k; i < l; i++) {
    sum = sum - nums[i - k] + nums[i];
    if (sum > maxSum) {
      maxSum = sum;
    }
  }
  return maxSum / k;
};

